import { useState } from 'react'; 


const Navbar = () => {
    const [isShow, setisShow] = useState(false);  

    const toggleMenu =() => {
        setisShow(!isShow);
    } 



    return(
        <nav className="navbar" id="navbar">
      {/*       <NavLink to={'/'}><img src= 'images/bakersinncategory.png' alt=""/></NavLink>
